import styled from 'styled-components';

const style = () => styled.div`
    .form-container {
        display: grid;
        grid-template-columns: 1fr 1fr;

        .right {
            margin: 0 auto;

            .form {

                .form-header {
                    color: #706f70;
                }

                input {
                    border: none;
                    color: #706f70;
                    padding: 15px 20px;
                    width: 50%;
                    margin-bottom: 20px;
                    background: #efefef;
                    border-radius: 5px;
                }

                input::placeholder {
                    color: #706f70;
                }
            }
        }
    }

`

export default style
